response.about:
Возможности системы:

- на одном сайте размещена информация о большом количестве надежных поставщиков обедов в офис;

- есть возможность поиска подходящих поставщиков по станции метро;

- вся информация о предлагаемых меню представлена по единому образцу, каждый день новое меню;

- каждый сотрудник может делать заказ самостоятельно на своем рабочем месте;

- система сама подсчитывает количество заказанных блюд на выбранный день и их общую стоимость;

- отправка заказа от всей компании производится нажатием одной кнопки - не нужно дозваниваться до поставщика и диктовать ему информацию по телефону или передавать ее по факсу;

- при желании поменять меню, нужно просто сделать заказ у другого поставщика, который доступен по району доставки.
